import { Component, OnInit } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { Order, OrderItem, OrderItemService, OrderService, PaymentService } from '../../../core';
// import { environment } from '../../../environments/environment.development';


@Component({
  selector: 'app-success',
  templateUrl: './success.component.html',
  styleUrls: ['./success.component.scss']
})
export class PaymentSuccessComponent implements OnInit {

  orderId: number;
  orderItems: OrderItem[] = [];
  order: Order;

  constructor(
    private route: ActivatedRoute,
    private orderItemService: OrderItemService,
    private paymentService : PaymentService,
    private orderService:OrderService,
    
  ) { }

  ngOnInit(): void {
    this.route.queryParams.subscribe(params => {
      if (params['orderId']) {
        this.orderId = +params['orderId']; // Convert to number
        this.orderItemService.getOrderItemsByOrderId(this.orderId).subscribe((result)=>{
          this.orderItems=result;
        console.log(this.orderItems);
        });
      } else {
        console.error('Order ID not found in query parameters');
      }
    });

    this.orderService.findById(this.orderId).subscribe(result=>{
      this.order=result;
      console.log("order data:-",this.order);
    })
  }

  downloadInvoice() {
    const invoiceData = {
      "logo": "data:image/png;base64,",
      "from": "BizERP\nLaxuria Buissness Hub\nSurat, 395006,\nGujarat",
      "to": this.order.customer.name,
      "currency": "inr",
      "number": "INV-0001",
      "payment_terms": "Auto-Billed - Do Not Pay",
      "items": this.orderItems.map(orderItem => {
        return {
          "name": orderItem.product.name,
          "quantity": orderItem.quantity,
          "unit_cost": orderItem.product.price
        };
      }),
      "fields": {
        "tax": "%"
      },
      "tax": 5,
      "notes": "Thanks for being an awesome customer!",
      "terms": "No need to submit payment. You will be auto-billed for this invoice."
    };

    this.paymentService.generateInvoice(invoiceData).subscribe((response: any) => {
      this.downloadFile(response);
    }, (error) => {
      console.error('Error generating invoice:', error);
    });
  }

  downloadFile(data: any) {
    const blob = new Blob([data], { type: 'application/pdf' });
    const url = window.URL.createObjectURL(blob);
    window.open(url);
  }
}
